import React from 'react';
import sass from './Navbar.module.scss';
const Navbar = () => {
	return (
		<nav>
			<div className="logo">
				<img src="" alt="" />
			</div>
			<div className="nav-item">
				<div className="nav-link"> <a href="#" >Home</a> </div>
				<div className="nav-link"> <a href="#" >About</a> </div>
				<div className="nav-link"> <a href="#" >Services</a> </div>
				<div className="nav-link"> <a href="#" >Portfolio</a> </div>
				<div className="nav-link"> <a href="#" >Page</a> </div>
				<div className="nav-link"> <a href="#" >Contact</a> </div>
				<div className="nav-button"> <a href="#" >Get Free Consultant</a> </div>
			</div>
		</nav>

	);
}
export default Navbar;
